import React, { useEffect } from "react";
import { useDispatch, useSelector } from "react-redux";
import { Link } from "react-router-dom";
import { listUsers } from "../actions/userActions";
import DeleteUser from "../components/DeleteUser";

export default function Users(props) {
  const dispatch = useDispatch();
  const usersList = useSelector((state) => state.userList);
  const { users } = usersList;

  console.log(users);

  // const header = Object.keys(users);
  // console.log(header);
  // const keys = header.map((key, index) => {
  //   return key.toUpperCase();
  // });
  // console.log(keys);

  useEffect(() => {
    dispatch(listUsers());
  }, [dispatch]);

  // const usersData = (users) => {
  //   this.users?.map((user) => {
  //     return (
  //       <tr key={user._id}>
  //         <td>{user.name}</td>
  //         <td>{user._id}</td>
  //         <td>{user.email}</td>
  //       </tr>
  //     );
  //   });
  // };
  // console.log(usersData());

  return (
    <div>
      <div>
        <table>
          <tr>
            <td>Name</td>
            <td>Email</td>
            <td>Id</td>
            <td>Phone Number</td>
            <td>Actions</td>
          </tr>
          {/* <tbody>{usersData()}</tbody> */}
          {users?.map((user) => (
            <tr>
              <td>
                <Link to={`/user/${user._id}`}>{user.name}</Link>
              </td>
              <td>{user.email}</td>
              <td>{user._id}</td>
              <td>{user.phoneNumber}</td>
              <td className="col-5">
                <p>
                  <Link to="/updateUser">Update</Link>
                  (..)
                  <DeleteUser />
                </p>
              </td>
            </tr>
          ))}
        </table>
      </div>
    </div>
  );
}

